import React from 'react';
import logo from '../images/bacola-logo.png';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Input from '@mui/material/Input';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function Navbar() {
  // ==========Grid==================
  const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));
  // =================================
  //============Select================
  const [age, setAge] = React.useState('');
  const handleChange = (event) => {
    setAge(event.target.value);
  };
  // =================================
  return (
    <>
      <div className='navMain'>
        <div className='subMain'>
          <div className='navFirst'>
            <div className='navFirstMain'>
              <div className='navFirstMainFirst'>
                <Input placeholder="Placeholder" inputProps="ariaLabel" />
              </div>
              <div className='navFirstMainSecond'>
                <FormControl>
                  <Select
                    className='select'
                    value={age}
                    onChange={handleChange}
                    displayEmpty
                    inputProps={{ 'aria-label': 'Without label' }}
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                  </Select>
                  <FormHelperText>Without label</FormHelperText>
                </FormControl>
              </div>
              <div className='navFirstMainThird'>
                khairullah
              </div>
            </div>
          </div>
          <div className='logoDiv'>
            {/* <img src={logo} className='logoimg' alt='logo' /> */}
            <p className='underLogoText'>Online Grocery Shopping Center</p>
          </div>
          <div className='logoDiv'>
            {/* <img src={logo} className='logoimg' alt='logo' /> */}
            <p className='underLogoText'>Online Grocery Shopping Center</p>
          </div>
        </div>
      </div>
    </>
  )
}














